// Lấy các phần tử DOM
const artistForm = document.getElementById('artistForm');
const nameInput = document.getElementById('name');
const genreInput = document.getElementById('genre');
const birthYearInput = document.getElementById('birthYear');
const imageInput = document.getElementById('image');
const addButton = document.getElementById('addButton');
const updateButton = document.getElementById('updateButton');
const cancelButton = document.getElementById('cancelButton');
const artistTable = document.getElementById('artistTable');
const prevPageBtn = document.getElementById('prevPage');
const nextPageBtn = document.getElementById('nextPage');
const notification = document.getElementById('notification');
const featuredArtistsDiv = document.getElementById('featuredArtists');

const artists = JSON.parse(localStorage.getItem('artistss')) || [];
let editIndex = -1;
const itemsPerPage = 8;
let currentPage = 1;

// Hàm hiển thị thông báo
function showNotification(message, type = 'success') {
    console.log('Hiển thị thông báo:', message, type);
    notification.textContent = message;
    notification.className = type;
    notification.classList.add('show');
    setTimeout(() => {
        notification.classList.remove('show');
    }, 3000);
}

// Hiển thị danh sách nghệ sĩ nổi bật
function renderFeaturedArtists() {
    console.log('Hiển thị nghệ sĩ nổi bật:', artists.filter(a => a.isFeatured));
    featuredArtistsDiv.innerHTML = '';
    const featuredArtists = artists.filter(artist => artist.isFeatured);
    if (featuredArtists.length === 0) {
        featuredArtistsDiv.innerHTML = '<p>Chưa có nghệ sĩ nổi bật.</p>';
        return;
    }
    featuredArtists.forEach(artist => {
        const card = document.createElement('div');
        card.className = 'featured-artist-card';
        const imageSrc = artist.image || 'https://via.placeholder.com/100';
        card.innerHTML = `
                    <img src="${imageSrc}" alt="Ảnh nghệ sĩ">
                    <h3>${artist.name}</h3>
                    <p>${artist.genre}</p>
                `;
        featuredArtistsDiv.appendChild(card);
    });
}

// Hiển thị danh sách nghệ sĩ cho trang hiện tại
function renderArtists() {
    console.log('Hiển thị nghệ sĩ, trang:', currentPage, 'danh sách:', artists);
    artistTable.innerHTML = '';
    const start = (currentPage - 1) * itemsPerPage;
    const end = start + itemsPerPage;
    const paginatedArtists = artists.slice(start, end);

    paginatedArtists.forEach((artist, index) => {
        const globalIndex = start + index;
        const row = document.createElement('tr');
        const imageSrc = artist.image || 'https://via.placeholder.com/50';
        row.innerHTML = `
                    <td><img src="${imageSrc}" class="artist-image" alt="Ảnh nghệ sĩ"></td>
                    <td>${artist.name}</td>
                    <td>${artist.genre}</td>
                    <td>${artist.birthYear}</td>
                    <td>
                        <button class="edit-btn" onclick="editArtist(${globalIndex})"><i class="fas fa-edit"></i> Sửa</button>
                        <button class="delete-btn" onclick="deleteArtist(${globalIndex})"><i class="fas fa-trash"></i> Xóa</button>
                        
                    </td>
                `;
        artistTable.appendChild(row);
    });

    // Cập nhật trạng thái nút phân trang
    prevPageBtn.disabled = currentPage === 1;
    nextPageBtn.disabled = end >= artists.length;
    renderFeaturedArtists();
}
renderArtists();

// Lưu danh sách nghệ sĩ vào localStorage
function saveArtists() {
    console.log('Lưu nghệ sĩ vào localStorage:', artists);
    localStorage.setItem('artistss', JSON.stringify(artists));
    renderArtists();
}

// Thêm hoặc cập nhật nghệ sĩ
artistForm.addEventListener('submit', (e) => {
    e.preventDefault();
    const artist = {
        name: nameInput.value,
        genre: genreInput.value,
        birthYear: birthYearInput.value,
        image: imageInput.value || (editIndex !== -1 ? artists[editIndex].image : null),
        isFeatured: editIndex !== -1 ? artists[editIndex].isFeatured : false
    };

    if (editIndex === -1) {
        // Thêm mới
        console.log('Thêm nghệ sĩ:', artist);
        artists.push(artist);

        showNotification('Thêm nghệ sĩ thành công!');
    } else {
        // Cập nhật
        console.log('Cập nhật nghệ sĩ tại index', editIndex, 'với dữ liệu:', artist);
        artists[editIndex] = artist;
        showNotification('Cập nhật nghệ sĩ thành công!');
        editIndex = -1;
        addButton.classList.remove('hidden');
        updateButton.classList.add('hidden');
        cancelButton.classList.add('hidden');
    }

    saveArtists();
    artistForm.reset();
    imageInput.value = ''; // Reset input
});

// Sửa nghệ sĩ
function editArtist(index) {
    console.log('Chỉnh sửa nghệ sĩ tại index:', index, 'dữ liệu:', artists[index]);
    const artist = artists[index];
    nameInput.value = artist.name;
    genreInput.value = artist.genre;
    birthYearInput.value = artist.birthYear;
    imageInput.value = artist.image || '';

    addButton.classList.add('hidden');
    updateButton.classList.remove('hidden');
    cancelButton.classList.remove('hidden');
    editIndex = index;
}

// Xóa nghệ sĩ
function deleteArtist(index) {
    console.log('Xóa nghệ sĩ tại index:', index);
    if (confirm('Bạn có chắc muốn xóa nghệ sĩ này?')) {
        artists.splice(index, 1);
        showNotification('Xóa nghệ sĩ thành công!');
        // Nếu trang hiện tại trống, chuyển về trang trước
        if ((currentPage - 1) * itemsPerPage >= artists.length && currentPage > 1) {
            currentPage--;
        }
        saveArtists();
    }
}

// Bật/tắt trạng thái nổi bật
function toggleFeatured(index) {
    console.log('Chuyển đổi trạng thái nổi bật tại index:', index);
    artists[index].isFeatured = !artists[index].isFeatured;
    showNotification(artists[index].isFeatured ? 'Đã thêm vào nghệ sĩ nổi bật!' : 'Đã xóa khỏi nghệ sĩ nổi bật!');
    saveArtists();
}

// Hủy chỉnh sửa
cancelButton.addEventListener('click', () => {
    console.log('Hủy chỉnh sửa');
    artistForm.reset();
    imageInput.value = '';
    addButton.classList.remove('hidden');
    updateButton.classList.add('hidden');
    cancelButton.classList.add('hidden');
    editIndex = -1;
});

// Điều hướng trang trước
prevPageBtn.addEventListener('click', () => {
    if (currentPage > 1) {
        currentPage--;
        renderArtists();
    }
});

// Điều hướng trang sau
nextPageBtn.addEventListener('click', () => {
    if (currentPage * itemsPerPage < artists.length) {
        currentPage++;
        renderArtists();
    }
});

// Hiển thị danh sách nghệ sĩ khi tải trang
document.addEventListener('DOMContentLoaded', () => {
    console.log('Tải trang, danh sách nghệ sĩ:', artists);
    // Đảm bảo tương thích với dữ liệu cũ không có image và isFeatured
    artists = artists.map(artist => ({
        ...artist,
        image: artist.image || null,
        isFeatured: artist.isFeatured || false
    }));
    saveArtists();
});

// Hàm xóa nghệ sĩ
function deleteArtist(index) {
    console.log('Yêu cầu xóa nghệ sĩ tại index:', index);

    // Hiển thị modal
    const modal = document.getElementById('deleteModal');
    modal.style.display = 'flex';

    // Gắn sự kiện cho nút Xóa
    const confirmDelete = document.getElementById('confirmDelete');
    const cancelDelete = document.getElementById('cancelDelete');

    // Xử lý xác nhận xóa
    confirmDelete.onclick = () => {
        artists.splice(index, 1);
        showNotification('Xóa nghệ sĩ thành công!');
        // Nếu trang hiện tại trống, chuyển về trang trước
        if ((currentPage - 1) * itemsPerPage >= artists.length && currentPage > 1) {
            currentPage--;
        }
        saveArtists();
        modal.style.display = 'none'; // Ẩn modal
    };

    // Xử lý hủy xóa
    cancelDelete.onclick = () => {
        modal.style.display = 'none'; // Ẩn modal
        console.log('Hủy xóa nghệ sĩ tại index:', index);
    };
}

